import React, { Component } from "react";
import Navigation from "./components/Navigation";
import HomePage from "./views/HomePage";
import { getRequest } from "./requests/axiosLocalHost";

class App extends Component {
  constructor() {
    super();
    this.state = { jobs: undefined };

    this.passFormData = this.passFormDate.bind(this);
  }

  render() {
    let pageRender = jobs => {
      if (jobs === undefined) {
        return <HomePage passFormData={this.passFormData} />;
      } else {
        return <div>{typeof jobs}</div>;
      }
    };

    return (
      <div className="App">
        <Navigation />
        {pageRender(this.state.jobs)}
      </div>
    );
  }
}

export default App;
